import React, { Component } from 'react';
import { GoogleApiWrapper } from 'google-maps-react';

class NearbyRestaurants extends Component {
  state = {
    restaurants: [
      { name: 'Restaurant 1', popularOrder: 'Pizza', imageUrl: 'url_to_image_1' },
      { name: 'Restaurant 2', popularOrder: 'Burger', imageUrl: 'url_to_image_2' },
      // Add more restaurants with their popular orders and image URLs
    ]
  };

  render() {
    const { restaurants } = this.state;

    return (
      <div>
        <h2>Recommended Restaurants</h2>
        {restaurants.map((restaurant, index) => (
          <div key={index}>
            <h3>{restaurant.name}</h3>
            <p>Popular Order: {restaurant.popularOrder}</p>
            <img src={restaurant.imageUrl} alt={`Popular order at ${restaurant.name}`} />
          </div>
        ))}
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'YOUR_API_KEY'
})(NearbyRestaurants);
